INSERT INTO `event_reports` VALUES ('0e53a932-a7f9-47ac-8c57-e9c3a4441875','	IIC Activity, Session on The Entrepreneurs Journey: Design Thinking for Impact was conducted on 19th January 2026.\n	Dr. B. Perumal, Innovation Ambassador, Associate Professor, Department of EEE, Adhiyamaan College of Engineering, Hosur, actively contributed as a resource person\n	He shared valuable insights on design thinking, entrepreneurial mindset, and transforming ideas into impactful solutions.\n	The session motivated the students to think creatively, approach problems innovatively, and explore entrepreneurship as a career pathway.\n	Overall, the program provided valuable exposure to innovation-driven thinking and real-world problem-solving skills. \n	A total of 56 students and 1 faculty participated in the program\n',56,1,0,'{\"youtube\": \"https://youtu.be/R3W3cXqcpuA\", \"facebook\": \"https://www.facebook.com/share/1F6Sio1pQE/\", \"linkedin\": \"https://www.linkedin.com/posts/adhiyamaan-college-of-engineering-hosur-34841825b_greetings-from-adhiyamaan-college-of-engineering-activity-7420355346231291904-JRR0?utm_source=social_share_video_v2&utm_medium=android_app&rcm=ACoAAEmVIukBWsbo_vG-UczKYe_giYr7Dr18y-c&utm_campaign=whatsapp\", \"instagram\": \"https://www.instagram.com/p/DT1_JOJko3X/?igsh=ODMzYW9ycGVwdWJv\"}','[]','2026-02-10 14:21:08','Institute Council','ACE-2978',0),('0edd7768-c34d-4807-9515-9bc48198c4dc','From Prototype to Entrepreneurial Launch successfully empowered participants to transform innovative ideas into viable, market-ready solutions. Through hands-on prototyping, design thinking, and AI-driven approaches, the program bridged the gap between concept and commercialization, fostering an entrepreneurial mindset and equipping participants with the skills needed to build, validate, and launch sustainable startups with confidence.',60,1,0,'{\"instagram\": \"https://www.instagram.com/p/DUgRi-agVtS/?igsh=dGdzeGJpcGlvajI2\"}','[\"http://192.168.46.90:3000/uploads/files-1770790051916-338203487.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770790051923-84456918.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770790051932-460577752.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770790051944-312533163.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770790051953-559594234.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770790051963-325417107.jpeg\"]','2026-02-11 11:37:31','Institute Council','ACE-7092',0),('1457658a-706d-4902-816d-9b0088a1e076','The R&D Awareness and Capacity Building Programme conducted on 4th February 2026 was a highly informative and impactful event that successfully achieved its intended objectives. The programme provided valuable insights into Technology Readiness Levels (TRL) and Manufacturing Readiness Levels (MRL), helping participants understand the importance of translating innovative ideas into practical, scalable, and market-ready solutions. The sessions encouraged a research-oriented mindset among students and faculty members and highlighted the significance of structured R&D processes in academia and industry.\n\nThe enthusiastic participation, interactive discussions, and positive feedback from attendees reflected the relevance and effectiveness of the programme. This event not only enhanced awareness about research, innovation, and commercialization pathways but also motivated participants to actively engage in research projects, startups, and innovation-driven activities. The Institutions Innovation Council (IIC), R&D Cell, and Idea Caf played a crucial role in organizing the programme smoothly and successfully. Overall, the programme served as a strong foundation for fostering a culture of research, innovation, and technological advancement within the institution, and it is expected to inspire future R&D initiatives and collaborations.',300,9,0,'{\"linkedin\": \"https://www.linkedin.com/company/adhiyamaan-college-of-engineering-ace?originalSubdomain=in\"}','[\"http://192.168.46.90:3000/uploads/files-1770880444907-821786302.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770880444914-682295361.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770880444916-17477449.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770880444918-654960162.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770880444921-402399989.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770880444922-804595357.jpeg\"]','2026-02-12 12:44:04','Institute Council','ACE-3455',2),('1a89a8cb-ed09-4861-9af3-b220fa796f56','Successfully Organized a Exposure Visit and completed',100,4,0,'{}','[]','2026-02-10 15:48:02','Institute Council','ACE-7176',0),('2d8c53e6-a378-41bf-92c5-fe46968455d4','An entrepreneurial approach encourages engineers to think creatively, act strategically, and focus on delivering value to society.',50,2,0,'{\"instagram\": \"https://www.instagram.com/p/DUkQWThjwHK/?igsh=N2c3NDA3dzBxY3hh\"}','[\"http://192.168.46.90:3000/uploads/files-1770803161000-621108811.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770803161002-737675259.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770803161005-731473517.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770803161019-564730238.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770803161020-874459500.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770803161021-487801934.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770803161022-554603122.jpeg\"]','2026-02-11 15:16:01','Institute Council','ACE-1671',0),('3651e4ca-28ec-440d-8e7c-17609229d961','Prototyping is the heartbeat of startup innovation. It transforms ideas from imagination into tangible solutions, enabling entrepreneurs to test, learn, and improve at high speed with minimal risk. In todays competitive world, startups cannot wait for perfect productssuccess belongs to those who experiment early, fail fast, and iterate smarter.\n\nThrough prototyping, innovators understand real user needs, reduce development costs, attract investors, and build confidence within their teams. Every prototypewhether paper sketch, digital mockup, or functional modelis a step closer to creating meaningful and market-ready products. \nFinally, Students got the Knowledge of ,\nFaster validation of ideas-\nQuickly test assumptions and identify what works before investing significant time or resources.\nLower risk and development costs-\nCatch design flaws early, reducing expensive changes later in the process.\nStronger user-centred solutions-\nGather real feedback early to design solutions that truly meet user needs.\nImproved collaboration and communication-\nUse tangible prototypes to align teams, clarify ideas, and support better decision-making.\nEnhanced creativity and real-world skills-\nEncourage experimentation while building practical, industry-relevant innovation skills.\n',59,1,0,'{\"instagram\": \"https://www.instagram.com/p/DUm3WnsgRB3/?igsh=MXJ0OXR6OTV3NWQwdw==\"}','[\"http://192.168.46.90:3000/uploads/files-1770793286279-547597896.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770793286299-899790381.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770793286318-465257778.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770793286329-717689055.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770793286340-895165580.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770793286351-532680494.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770793286362-713964565.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770793286371-783429380.jpeg\"]','2026-02-11 12:31:26','Institute Council','ACE-6737',1),('3c7a0737-8424-416c-b215-364ffbc27d70','The R&D Awareness and Capacity Building Programme on Training on Technology Commercialization, Licensing and Transfer Practices & Strategy was organized by the Institutions Innovation Council 8.0, R&D Cell and Idea-Cafe of Adhiyamaan College of Engineering (An Autonomous Institution), Hosur, on 10 February 2026 at the AERO Seminar Hall. The programme aimed to strengthen the research, innovation and product development ecosystem of the institution.\nThe programme was conducted under the patronage of Dr. R. Radhakrishnan, Principal and the co-patronage of Dr. R. Dhanasekaran, Dean  Industry Relations. It was convened by Dr. M. A. Suresh Kumar, R&D Cell Coordinator, with coordination support from Dr. N.Priya, Associate Professor/MBA and Mr. Dhanasekaran, AP, B.Tech, Chemical Engineering. Mrs. Tamil Selvi, AP, BE CSE.\nThe primary objective of the program was to create awareness and build capacity among faculty members and researchers on technology commercialization, licensing and technology transfer strategies. The program aimed to enhance understanding of how academic research can be transformed into market-ready innovations, thereby strengthening the institutions R&D and innovation ecosystem.\nThe programme commenced with a welcome address to the dignitaries, resource persons, faculty members and student participants. Dr. R. Dhanasekaran, Dean  IR Adhiyamaan College of Engineering, Hosur. Provided insights into institutional mechanisms for technology transfer and licensing, stressing the significance of R&D policies and innovation-driven culture.\nThe second technical session was handled by Dr. M. Dhanasekaran, Professor& Head, and Department of Management Studies. and Innovation Ambassador, who emphasized the. Elaborated on the role of higher educational institutions in fostering innovation and emphasized the need for aligning academic research with industry requirements. He guided participants on aligning academic research, funded projects and student innovations with national innovation and start-up frameworks.\nDr. M. A. Suresh Kumar, Associate Professor, Department of Management Studies Innovation Ambassador, ACE  Hosur discussed practical aspects of commercialization strategies and shared experiences related to innovation ambassadorship and industry collaboration.. The programme strengthened industryacademia collaboration, motivated applied research and contributed to fostering a strong R&D culture within the institution.\nThe programme concluded with a vote of thanks, acknowledging the management, Principal, Dean (IR), Resource persons, Coordinators, faculty members and students\' participants for making the programme a success.\n',275,9,0,'{\"twitter\": \"https://x.com/DepartmentAce/status/2021879675203858712?s=20\", \"facebook\": \"https://www.facebook.com/share/p/1DD8pM9dp6/\", \"instagram\": \"https://www.instagram.com/p/DUpxlObASYS/?utm_source=ig_web_copy_link&igsh=MzRlODBiNWFlZA==\"}','[\"http://192.168.46.90:3000/uploads/files-1770890168404-183701107.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770890168411-862537209.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770890168420-761243843.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770890168433-985416875.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770890168443-332698514.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770890168452-187948537.jpeg\"]','2026-02-12 15:26:08','Student Council','ACE-6119',0),('3e1786a5-cd95-4e4d-b391-bda002254322','Students developed a comprehensive understanding of the technical and business dimensions of innovation, preparing them for careers in entrepreneurship',60,2,0,'{\"linkedin\": \"https://www.linkedin.com/posts/kalai-vani-v-7731b4278_activity-7419742610367586304-AsdG?utm_source=share&utm_medium=member_android&rcm=ACoAAEOpJkcBvnUKBb78Q2NHyPqRD40L7CPzBNM\"}','[\"http://192.168.46.90:3000/uploads/files-1770785251321-210051952.jpg\", \"http://192.168.46.90:3000/uploads/files-1770785251322-182589393.jpg\", \"http://192.168.46.90:3000/uploads/files-1770785251325-8197677.jpg\", \"http://192.168.46.90:3000/uploads/files-1770785251330-892374609.jpg\", \"http://192.168.46.90:3000/uploads/files-1770785251331-601343095.jpg\", \"http://192.168.46.90:3000/uploads/files-1770785251333-486748577.jpg\"]','2026-02-11 10:17:31','Institute Council','ACE-4193',0),('4590ada7-bc56-400d-850d-0b6e8bd88af0','t