iles-1770802651254-58484339.jpg\", \"http://192.168.46.90:3000/uploads/files-1770802651257-473062293.jpg\", \"http://192.168.46.90:3000/uploads/files-1770802651281-688554976.jpg\"]','2026-02-11 15:07:31','Institute Council','ACE-8303',1),('fa0765f1-cd98-4f69-b310-bda4ad41210b','The Programme was successfully conducted and met the Objective and Expected Outcomes',60,1,0,'{\"instagram\": \"https://www.instagram.com/p/DUAE_dOAZIk/?igsh=MXJiOHViNXExNnl6eg%3D%3D\"}','[\"http://192.168.46.90:3000/uploads/files-1769586151824-130253677.jpg\", \"http://192.168.46.90:3000/uploads/files-1769586151828-855198421.jpg\", \"http://192.168.46.90:3000/uploads/files-1769586151831-69543471.jpg\", \"http://192.168.46.90:3000/uploads/files-1769586151834-92172249.jpg\"]','2026-01-28 13:12:31','Institute Council','ACE-5871',0),('fdb9c261-6d98-46fe-bb52-51c152663a2e','The R&D Awareness and Capacity Building Programme on Intellectual Property (IP) Generation and Commercialization  IP Awareness and Patent Filing Workshop was organized by the Institutions Innovation Council (IIC) 8.0, R&D Cell, and IDEA Caf of Adhiyamaan College of Engineering (An Autonomous Institution), Hosur, on 11 February 2026 at the AERO Seminar Hall. The programme was designed to strengthen the institutions research, innovation, and patent development ecosystem.\nThe event was conducted under the esteemed patronage of Dr. R. Radhakrishnan, Principal, and the co-patronage of Dr. R. Dhanasekaran, Dean  Industry Relations. The programme was convened by Dr. M. A. Suresh Kumar, R&D Cell Coordinator, with coordination support from Mr. M. Kaviyarasu, Assistant Professor/BME, Mrs. B. Uma, Assistant Professor/ECE and Mr. N. Sakthivel, Assistant Professor/MCA.\nThe primary objective of the programme was to create awareness among students and faculty about the significance of Intellectual Property Rights (IPR) and to provide foundational knowledge on patent identification, drafting, filing procedures, and commercialization strategies, thereby fostering an innovation-driven and research-oriented culture within the institution.\nThe programme commenced with a formal welcome address to the dignitaries, resource persons, faculty members, and student participants. The First technical session was delivered by Dr. R. Dhanasekaran, Dean  IR, Adhiyamaan College of Engineering, Hosur, addressed the gathering and emphasized the importance of intellectual property in academic research and industry collaboration.\nThe Second technical session was delivered by Dr. S. Sumathi, Professor & Head, Department of Electronics and Communication Engineering, and Innovation Ambassador. She provided valuable insights into Intellectual Property Rights and IP commercialization, covering key aspects such as patents, copyrights, trademarks, and research publication ethics.\nThe programme concluded with a vote of thanks, expressing sincere appreciation to the Management, Principal, Dean  IR, resource persons, coordinators, faculty members, and student participants for their valuable contributions in making the event a grand success.',250,10,0,'{\"linkedin\": \"https://www.linkedin.com/posts/bagyalakshmi-nagarajan-512aba1a7_biomedical-ipr-iprandcommercialization-ugcPost-7427278857579376640-DrHJ?utm_source=share&utm_medium=member_desktop&rcm=ACoAADBlKV4B_ekowguV90E2NfxCfoJiS9c4vCw\"}','[\"http://192.168.46.90:3000/uploads/files-1770893226139-275269408.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770893226146-537923943.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770893226152-260089225.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770893226162-480646931.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770893226173-425403277.jpeg\", \"http://192.168.46.90:3000/uploads/files-1770893226182-692979056.jpeg\"]','2026-02-12 16:17:06','Institute Council','ACE-5324',1);
