 Infrastructure\"]','[\"IIC\"]','Master of Business Administration (MBA)','[\"MRS. KAVITHA T\"]','[\"9080413752\"]','[\"MR. R. NAVEEN PRAKASH\"]','[\"ASSISTANT PROFESSOR/ DEPARTMENT OF MANAGEMENT STUDIES\"]','[\"8056865091\"]',0.00,'[]','[\"posters\"]','http://192.168.46.90:3000/uploads/file-1768969889407-978921829.jpeg','offline',NULL,NULL,'2026-01-22 13:46:37','2026-01-24 09:30:36','2026-02-03 16:33:09','47bfbd41-5028-444d-93ed-28fe394bba87','2026-01-21 10:01:29','2026-02-03 16:33:09',NULL),('fa0765f1-cd98-4f69-b310-bda4ad41210b','Alumni Lecture Series on \" Role of Java in driving Innovation, Entrepreneurship and Industry Solutions\"','Industry Academic Linkage,  Skill Orientation, Stake Holder Participation','AOT7QY','approved','2026-01-24',NULL,'10:30:00','12:30:00',NULL,NULL,'AV Room -Room. No.108','2025-2026','Quarter II','Institute Council','Level 1 - Expert Talk','Innovation & Design Thinking',NULL,70,'[\"students\"]','* To provide students with industry-oriented insights on how Java technologies contribute to real-world problem solving and innovation.\n* To bridge the gap between academic learning and industrial applications through alumni expertise.\n* To create awareness among students about entrepreneurial opportunities and startup ecosystems    leveraging Java-based platforms.\n* To expose students to current industry trends, frameworks, and tools built using Java.','To gain a clear understanding of Javas role in modern industry applications and emerging technologies.\nTo Enhance awareness among students about innovation-driven software development using Java.\nTo Improve understanding of entrepreneurial opportunities and startup development using Java-based solutions.\nTo Foster an industry-oriented mindset among students, supporting their career readiness.','[\"SDG 4: Quality Education\", \"SDG 9: Industry, Innovation and Infrastructure\"]','[\"IIC\", \"extended curricular activity\", \"alumini\"]','CSE (B.E)','[\"R DhanaLakshmi\", \"C Akshaya\"]','[\"8825513864\", \"8489021688\"]','[\"Mr V Ilanthenral\"]','[\"Dyashin Technosoft Pvt. Ltd, Bangalore\"]','[\"6382371943\"]',250.00,'[\"department\"]','[\"social media\", \"posters\"]','http://192.168.46.90:3000/uploads/file-1768983359480-766340705.jpg','offline',NULL,NULL,'2026-01-21 13:47:52','2026-01-21 14:00:28','2026-01-22 16:52:08','00b616aa-83c1-481e-944c-bfd3c0333701','2026-01-21 13:45:59','2026-01-22 16:52:08',NULL),('fdb9c261-6d98-46fe-bb52-51c152663a2e','Intellectual Property (IP) Generation and Commercialization: IP Awareness and Patent Filing Workshops','The Workshop on Intellectual Property Rights (IPR), Patents, Copyrights, Trademarks, and Research Publication Ethics aims to create awareness among students about protecting intellectual creations and practicing ethical research. As students are actively involved in research projects, innovations, and creative works, understanding IPR and publication ethics is essential in the present academic and innovation ecosystem.\nThe workshop introduces the fundamentals of Intellectual Property Rights, focusing on patents, copyrights, and trademarks. Students gain basic knowledge of patentability, the patent filing process, and the importance of patent searches to safeguard innovative ideas. The session on copyrights highlights protection of academic writing, project reports, software, and digital content, along with fair use and infringement issues. Trademarks are explained in the context of branding, startups, and entrepreneurship.\nA dedicated session on Research Publication Ethics sensitizes students to plagiarism prevention, proper citation, authorship norms, and responsible research practices, fostering integrity, originality, and ethical awareness.','6P5JQ3','approved','2026-02-11','2026-02-11','10:00:00','16:00:00',NULL,'c5f74a5e-42a1-4aab-94a3-1bfe9b5fbcfe',NULL,'2025-2026','Quarter I','Institute Council','Level 2 - Workshop','IPR & Technology Transfer',NULL,250,'[\"students\", \"faculty\"]','To create awareness among students about the fundamentals of IPR and protection mechanisms.','Students will be able to apply basic IPR principles to identify suitable protection mechanisms for their projects, innovations, and creative works.','[\"SDG 9: Industry, Innovation and Infrastructure\"]','[\"R & D\"]','Biomedical Engineering, Electronics and Communication Engineering, Master of Computer Application','[\"Mr. M. Kaviyarasu,AP/BME\", \"Mrs. B. Uma, AP/ECE\", \"Mr. N. Sakthivel, AP/MCA\"]','[\"8489736186\", \"9940710510\", \"9894878720\"]','[\"Dr.R.Dhanasekaran\", \"Dr.S.Sumathi\"]','[\"Dean-IR, ACE Hosur\", \"Professor & Head, Department of ECE, ACE Hosur\"]','[\"9043793491\", \"9487819151\"]',0.00,'[]','[\"social media\", \"posters\"]','http://192.168.46.90:3000/uploads/file-1770369415153-59191589.jpeg','offline',NULL,NULL,NULL,'2026-02-06 17:12:58','2026-02-10 17:11:06','8cf0e238-abba-4dff-afdd-12579217cdb2','2026-02-06 14:46:55','2026-02-10 17:11:06',NULL),('ff939b12-1e4b-4911-9ba0-7408f71ece14','Poster Making Competition','Skill Orientation','RG4BTE','approved','2026-01-22',NULL,'09:30:00','12:30:00',NULL,'817ec237-623a-4120-b103-7c981d67cc10',NULL,'2025-2026','Quarter I','Institute Council','Level 2 - Competition','Innovation & Design Thinking',NULL,174,'[\"students\"]','To promote creativity, awareness, and effective communication of ideas through visual representation.','Participants will be able to identify real-world cyber issues such as phishing, malware, data breaches, and cyber fraud.','[\"SDG 4: Quality Education\"]','[\"extended curricular activity\"]','CSE(CYBER SECURITY) (B.E)','[\"Mrs.M.Kanimozhi\"]','[\"9344863518\"]','[\"Mr. Sreeram\"]','[\"Senior Security analyst, Siemens Healthieners, Bangalore\"]','[\"9344863518\"]',500.00,'[\"institution\"]','[\"posters\"]','http://192.168.46.90:3000/uploads/file-1768900977573-177777584.jpg','offline',NULL,NULL,'2026-01-21 09:12:41','2026-01-21 13:59:09','2026-02-03 16:32:41','d1c0ad7b-4e90-4975-9269-5f7ce5edbe59','